import React, { useState } from 'react';
import { TextField, IconButton, Paper } from '@mui/material';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({
  container: {
    display: 'flex',
    alignItems: 'center',
    gap: '10px', // Odstęp między polem tekstowym a przyciskiem
  },
  textField: {
    backgroundColor: '#000', // Czarny kolor tła
    color: '#fff', // Biały kolor tekstu
    '& .MuiInputBase-input': {
      color: '#fff', // Biały kolor tekstu
    },
    '& .MuiFormLabel-root': {
      color: '#fff', // Biały kolor etykiety
    },
  },
  button: {
    color: '#fff', // Biały kolor ikony
    backgroundColor: '#000', // Czarny kolor tła
    '&:hover': {
      backgroundColor: '#333', // Ciemniejszy czarny na hover
    },
  },
});

export default function InputWithArrowButton() {
  const classes = useStyles();
  const [inputValue, setInputValue] = useState('');

  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleButtonClick = () => {
    alert('Button clicked with input value: ' + inputValue);
  };

  return (
    <div className={classes.container}>
      <TextField
        className={classes.textField}
        variant="outlined"
        placeholder="Wpisz coś..."
        value={inputValue}
        onChange={handleInputChange}
        fullWidth
      />
      <IconButton
        className={classes.button}
        onClick={handleButtonClick}
        aria-label="submit"
      >
        <ArrowForwardIcon />
      </IconButton>
    </div>
  );
}
